import './App.css';
import Header from './Header';
import Footer from './Footer';
import Aside from './Aside';
import Main from './Main';
import Nav from './Nav';


const App=()=> {
  return (
    <div className='App'>
      <Header/><Nav/>

      <Main/>
      <Aside/>
      <Footer/>
    </div>
  );
}

export default App;
